// 统一请求路径前缀在libs/axios.js中修改
import { getRequest, postRequest, putRequest, deleteRequest, uploadFileRequest } from '@/libs/axios'; //分页模糊获取回收人员信息

export var getAllRecyclingPerson = function getAllRecyclingPerson(params) {
  return getRequest('/recyclingPersonnel/getByCondition', params);
}; //添加回收人员

export var addPerson = function addPerson(params) {
  return postRequest('/recyclingPersonnel/addPersonToRedis', params);
}; //编辑回收人员信息

export var editPerson = function editPerson(params) {
  return putRequest('/recyclingPersonnel/editPersonToRedis', params);
}; //删除回收人员信息

export var deletePerson = function deletePerson(ids, params) {
  return deleteRequest("/recyclingPersonnel/removeByIdsTwo/".concat(ids), params);
}; //查询是否有此回收人员

export var selectByPhone = function selectByPhone(params) {
  return getRequest('/recyclingPersonnel/getByPhone', params);
}; //分页模糊查询普通人户

export var getAllWechatUser = function getAllWechatUser(params) {
  return getRequest('/wechatUser/getWechatUser', params);
}; //编辑普通用户

export var editWechatUser = function editWechatUser(params) {
  return putRequest('/wechatUser/editWechatUser', params);
}; //验证手机号是否存在

export var getByPhoneNum = function getByPhoneNum(params) {
  return getRequest('/wechatUser/selectByPhoneAndClientType', params);
}; //分页模糊查询待审核的回收人员

export var getVerifyPerson = function getVerifyPerson(params) {
  return getRequest('/recyclingPersonnel/getVerifyPerson', params);
}; //根据id获取回收人员信息

export var getVerifyPersonById = function getVerifyPersonById(id) {
  return getRequest("/recyclingPersonnel/get/".concat(id));
}; //审核通过方法

export var changeStatusToPass = function changeStatusToPass(id, name, openId) {
  return getRequest("/recyclingPersonnel/changeStatusToPass/".concat(id, "/").concat(name, "/").concat(openId));
}; //审核不通过

export var changeStatusToFaild = function changeStatusToFaild(id, memo, name, openId) {
  return getRequest("/recyclingPersonnel/changeStatusToFaild/".concat(id, "/").concat(memo, "/").concat(name, "/").concat(openId));
};
